def add1(value1, value2):
    print(f'add1: value 1: {value1}, value 2: {value2}')
    if value2 == 0:
        return value1
    else:
        return 1 + add1(value1, (value2-1))

def add2(value1, value2):
    print(f'add2: value 1: {value1}, value 2: {value2}')
    if value2 == 0:
        return value1
    else:
        return add2((value1+1), (value2 - 1))
    

